import React from "react";

import "./Navbar.css";

const Navbar = () => {
  return (
    <nav className="navbar">
      <div>
        <h1>MovieFinder</h1>
      </div>

      <ul className="nav_links">
        <li>
          <a href="#">Home</a>
        </li>
        <li>
          <a href="#">My Movies</a>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
